 <title id="title">Sketch</title>

 <style type="text/css">
div.controls {
	-webkit-transition-property: opacity;
	-webkit-transition-duration: .4s;
	position: absolute; 
	top: 0;
	z-index: 100;
	padding: 15px;
	opacity: 0.5;
}
div.controls:hover {
	opacity: 1;
}
div#areaDraw {
	width: 100%;
	min-height: 100%;
	z-index: 1000;
}
 </style>

<div id="areaDraw"></div>
<div class="controls">

	 <input type="button" style="" value="Zoom">

 </div>
</div>
